import { AppBar, Toolbar } from "@mui/material";
import { Typography } from "@mui/material";
import { Link } from "react-router-dom";
import Button from "@mui/material/Button";
import { green } from "@mui/material/colors";


export default function MyAppBar(){

    return(

        <div>
            <AppBar position="static">
                <Toolbar sx={{color:"green"}}>
                    <Typography variant="h4" sx={{marginRight: 5}}>CampPlan</Typography>
                    <Link to={'/home'}>
                      <Button variant="contained" sx={{marginRight: 3}} color="secondary">Home</Button>    
                    </Link>
                    <Link to={'/trips'}>
                      <Button variant="contained" sx={{marginRight: 3}} color="secondary">My Trips</Button>    
                    </Link>
                    <Link to={'trips/create'}>
                      <Button variant="contained" sx={{marginRight: 3}} color="secondary">Create A Trip</Button>    
                    </Link>
                </Toolbar>
            </AppBar>
        </div>
    )
}
